438 \u043e\u043a\u043e\u043b\u043e 80 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u0442\u0440\u0451\u0445 \u0434\u043d\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2015_%D0%B3%D0%BE%D0%B4\" title=\"2015 \u0433\u043e\u0434\">2015<\/a>&#160;\u2014 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B8_%D0%B2_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B5_%D0%94%D0%B5%D0%B1%D0%B0%D0%BB%D1%8C%D1%86%D0%B5%D0%B2%D0%B0\" title=\"\u0411\u043e\u0438 \u0432 \u0440\u0430\u0439\u043e\u043d\u0435 \u0414\u0435\u0431\u0430\u043b\u044c\u0446\u0435\u0432\u0430\">\u0431\u043e\u0435\u0432 \u0437\u0430 \u0414\u0435\u0431\u0430\u043b\u044c\u0446\u0435\u0432\u043e<\/a>, \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%9D%D0%A0\" class=\"mw-redirect\" title=\"\u0414\u041d\u0420\">\u0414\u041d\u0420<\/a> \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044f \u043d\u0430\u0434 \u0433\u043e\u0440\u043e\u0434\u043e\u043c.<\/li><\/ul><h2>"}